import React, { useState } from 'react';

const ClickMe = () => {
    const [count,setCount]=useState(0);
    return (
        <div>
            <button onClick={(e)=>setCount(count+1)}>Click</button>
            <p>{count}</p>
        </div>
    );
};

export default ClickMe;
